import React, { useState } from "react";
import './navigation-panel.scss';
import { Link } from "react-router-dom";
import MenuIcon from '@mui/icons-material/Menu';
import ArrowBackIosNewIcon from '@mui/icons-material/ArrowBackIosNew';

function Navigation() {

    const [navList, setNavlist] = useState(false);
    const showNavlist = () => setNavlist(!navList);

    return (
        <div className={navList ? 'navlist active' : 'navlist'}>
            <div id="hamburger" className="hamburger" type="button" onClick={showNavlist}>
                {navList? <ArrowBackIosNewIcon sx={{position: 'absolute', bottom: '20px', left: '20px' }} /> : <MenuIcon sx={{ fontSize: 30,position: 'absolute', right: '-50px'}} />}
            </div>

            <ul id='nav-list' onClick={showNavlist}>
                <Link className="nav-panel-link" to='/dashboard'><li>
                    <span class="nav-text">
                        Dashboard
                    </span>
                </li></Link>

                <Link className="nav-panel-link" to='/fleet'><li>
                    <span class="nav-text">
                        Fleets
                    </span>
                </li></Link>

                <Link className="nav-panel-link" to='/cluster'><li>
                    <span class="nav-text">
                        Clusters
                    </span>
                </li></Link>
            </ul>
        </div>
    );
}

export default Navigation;
